const _hoisted_5 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Saber</li><li>True Name: Gilles de Rais</li><li>Gender: Male</li><li>Source: Historical fact</li><li>Origin: France</li><li>Alignment: Lawful Good</li><li>Height: 186 cm</li><li>Weight: 91 kg</li><li></li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Nasu Kinoko</li><li>Character Illustrator: Shinjirou</li><li>Character Voice: Tsuruoka Satoshi</li><li>Appearance in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [B]</strong></p><p>Invalidates magecraft with an activation chant below three verses.</p><p>Even being wounded by High-Thaumaturgy and Greater Rituals is difficult.</p><p><strong>Riding: [B]</strong></p><p>Talent for riding. Can ride normal vehicles with above average skill, but can\u2019t ride beasts on the level of Demonic Beast or Divine Beast.</p><p><strong>Mad Enhancement: [EX]</strong></p><p>Since it\u2019s a very special summoning, and the name of Gilles de Rais is much more famously known as \u2015\u2015\u2015 Bluebeard, even Saber will be granted the Mad Enhancement skill.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Military Tactics: [C]</strong></p><p>Tactical intuition in a battlefield in which a large number of people is mobilized, not for one versus one battles.</p><p>As Jeanne Darc\u2019s assistant, he obtained several military merits.</p><p>In the case of being under an attack similar to a siege battle, a bonus is particularly added.</p><p><strong>Golden Rule: [B]</strong></p><p>Predestination of how much money went around in life.</p><p>Having an enormous territory and heritage, he shouldn\u2019t have had any problem with money during his life, but\u2026\u2026</p><p><strong>Prelati\u2019s Encouragement: [A]</strong></p><p>Encouragement coming from Prelati. From where? Nobody knows.</p><p>It\u2019s Strength reinforcement through magecraft, but as a compensation, the memories from after Jeanne\u2019s death become clearer.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="saint-war-order-rally-upon-the-sacred-banner-and-roar" tabindex="-1"><a class="header-anchor" href="#saint-war-order-rally-upon-the-sacred-banner-and-roar" aria-hidden="true">#</a> Saint War Order - Rally upon the Sacred Banner and Roar</h1><ul><li>Rank: B</li><li>Type: Anti-Unit Noble Phantasm (Self)</li><li>Range: 1</li><li>Maximum number of targets: 1 person</li></ul><p>Saint War Order.</p><p>A Noble Phantasm that reproduces the moments when he was fighting under the flag of the saint Jeanne, in other words, the moment at which he was shining the most.</p><p>Together with a status up effect similar to Mad Enhancement, performs attacks automatically until the targeted enemy has been completely silenced. A bonus is added to the damage from attacks.</p><h1 id="prelati-s-spellbook-textbook-of-the-spiral-sunken-castle" tabindex="-1"><a class="header-anchor" href="#prelati-s-spellbook-textbook-of-the-spiral-sunken-castle" aria-hidden="true">#</a> Prelati\u2019s Spellbook - Textbook of the Spiral Sunken Castle</h1><ul><li>Rank: C</li><li>Type: Anti-Army Noble Phantasm</li><li>Range: 1~10</li><li>Maximum number of targets: 100 people</li></ul><p>Prelati\u2019s Spellbook.</p><p>A grimoire wrapped with human skin. Allows to summon and exploit a kind of water demons from the deep sea.</p><p>This book itself has a function as a mana furnace, and allows to perform spells on the level of High Thaumaturgy/Greater Rituals independently of the caster\u2019s mana.</p><p>\u2026\u2026 But, the Gilles de Rais that is a Saber doesn\u2019t use this Noble Phantasm even if he brings it with him.</p><p>Should he use it, he will automatically change his class to Caster, and \u300ERally upon the sacred banner and roar\u300F will be sealed. (Not used in \u300EFateGO\u300F).</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First person pronoun: \u79C1 (watashi)</li><li>Second person pronoun: \u3042\u306A\u305F (anata)</li><li>Third person pronoun: \u5F7C (kare) / \u5F7C\u5973 (kanojo)</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>Clear and bold, he strictly loves his native country from order.</p><p>An existence that has reached one apex as a knight, if he takes command at the battlefield, the soldiers will cheer up.</p><p>While fearing the darkness he carries inside, he reached the rank of marshal, the highest honor for a knight.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>Sincerely, he serves with earnestness. He who is an excellent warrior, will give accurate advice.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300CAfter winning, counting the number of victims left behind is a vain thing.\u300D</p><p>\u300CWhich is the right way\u2026\u2026 for me to go\u2026\u2026? No\u2026\u2026 Master\u2026\u2026 I dedicate my sword to you\u2026\u2026 It\u2019s just that\u2026\u2026 Just that\u2026\u2026\u300D</p><p>\u300CAbout the saint? Yes, I don\u2019t have any problem with talking, but\u2026\u2026 Do you have at least three hours to spare?\u300D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>A curiosity-seeking murderer that tortured very young children to death.</p><p>That\u2019s the valuation of Gilles de Rais nowadays. However, her wasn\u2019t such a being from the beginning.</p><p>He was a nobleman with a vast territory at the western region of France, and lived his life indulging in every possible luxury.</p><p>Had things stayed like this, he\u2019d have disappeared without being known by history as a libertine nobleman that didn\u2019t know the ways of the world.</p><p>A turning point will come to him.</p><p>The Hundred Years War \u2015\u2015\u2015 A war between France and England that had been unfolded across a long period of time. In the side of France, which was being gradually cornered, one saint appeared.</p><p>Jeanne Darc.</p><p>The Gilles de Rais that met her had accomplished several accomplishments in the Hundred Years War. It could be said that the coronation at Reims was truly the peak period for him.</p><p>But when Jeanne Darc was sentenced to burning at the stake, everything went mad.</p><p>Suffering, he returned again to his luxurious life, but his heart was already filled with emptiness.</p><p>And as he began to perform mysterious rituals like alchemy or black arts, he awakened the cruel disposition inherited from his grandfather.</p><p>The shape of the once virtuous knight Gilles de Rais couldn\u2019t be seen anywhere.</p><p>What was there was a murderer that had fallen into darkness.</p><p>And the judgment from God he believed that would someday come didn\u2019t \u2015\u2015</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Jeanne d&#39;Arc</strong></p><p>The girl I used to line up with. I don\u2019t regret having pledged everything for the girl, even my life, even my status.</p><p><strong>Jeanne d&#39;Arc (Alter)</strong></p><p>A once saint that has fallen to blackness. Even so, if she said \u300Cfollow me\u300D. I would gladly serve as her entourage to the ends of Hell.</p><p><strong>Gilles de Rais (Caster)</strong></p><p>I wonder what about those clothes. But looking well\u2026\u2026 Not bad\u2026\u2026 Hoho\u2026\u2026</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Since it was established that he\u2019d have the grimoire, the semi-fallen estate of the third stage was the initial design. There, I received a suggestion from Takeuchi-san, a beautiful Gilles (1 \u2013 2 stage) was born, and a story nature was given to the Ascensions. The fall to darkness of the heroine is erotic and nice. (Shinjirou)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-080.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-081.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-082.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-083.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-084.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-085.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-086.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-087.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-088.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-089.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 89);
